import React from 'react';
import Router from "../Router/Router"
import SiteHeader from './Componets/SiteHeader'
import SiteFooter from './Componets/SiteFooter'




export default function Content() {
  return (
    <>
      <SiteHeader />
      <Router />
      <SiteFooter />
    </>
  )
}
